import { Link } from 'react-router-dom';

const DUMYEVENTS = [{ id: 'event-1', Title: 'tytuł-1' }, 'event-2', 'event-3', 'event-4'];

const EventsPage = () => {
   return (
      <>
         <h1>EventsPage</h1>
         <ul>
            {DUMYEVENTS.map((event, i) => (
               <li id={i}>
                  <Link id={i} to={`${event}`}>
                     {event}
                  </Link>
               </li>
            ))}
         </ul>
      </>
   );
};

export default EventsPage;
